import ButtonsComponent from "./buttonComponents"
import { useState } from "react";
export default function Sistemele(){
    const [color, setColor] = useState('white');

    const handleColorChange = (event) => {
        const selectedColor = event.target.value;
        switch (selectedColor) {
            case 'roșu':
                setColor('red');
                break;
            case 'verde':
                setColor('green');
                break;
            case 'albastru':
                setColor('blue');
                break;
            case 'roșu+verde':
                setColor('yellow');
                break;
            case 'roșu+albastru':
                setColor('magenta');
                break;
            case 'verde+albastru':
                setColor('cyan');
                break;
            case 'roșu+verde+albastru':
                setColor('white');
                break;
            default:
                setColor('black');
        }
    };
    return(
        <>
       <div class="flex h-auto">
         <div className="w-1/6 bg-gray-600 p-4 overflow-auto">
                <ButtonsComponent currentButton={1} />
            </div>
            <div className="w-5/6 p-4 flex flex-col bg-gray-100">

        <h2>1.RGB (Red, Green, Blue)</h2>
       
        <p>
        Acest sistem se bazează pe teoria că orice culoare poate fi creată prin combinarea luminii roșii, verzi și albastre în proporții variate. 
        Culorile sunt create prin iluminarea subpixelilor. </p>
    <p>
    RGB este un model aditiv, ceea ce înseamnă că culorile sunt create prin combinarea luminii. Combinația maximă a celor trei culori (roșu, verde, albastru) produce alb. </p>
    <p>Fiecare culoare în sistemul RGB este reprezentată printr-o valoare între 0 și 255, unde 0 înseamnă absența completă a culorii respective și 255 înseamnă prezența completă a culorii. </p>

    <div className="p-5 flex w-full items-center">
    <div className="w-3/5">
        <h2 className="font-bold">Mixer de Culori Simplu</h2>
        <p>Toate culorile vor lua valoarea 255 (cea mai mare)</p>
    </div>
    <select onChange={handleColorChange} className="form-select appearance-none block w-auto px-3 py-1.5 text-base font-normal text-gray-700 bg-white bg-clip-padding bg-no-repeat border border-solid border-gray-300 rounded transition ease-in-out m-0 focus:text-gray-700 focus:bg-white focus:border-blue-600 focus:outline-none">
        <option value="">Selectați Combinația de Culori</option>
        <option value="roșu">Roșu</option>
        <option value="verde">Verde</option>
        <option value="albastru">Albastru</option>
        <option value="roșu+verde">Roșu + Verde</option>
        <option value="roșu+albastru">Roșu + Albastru</option>
        <option value="verde+albastru">Verde + Albastru</option>
        <option value="roșu+verde+albastru">Roșu + Verde + Albastru</option>
    </select>
    <div style={{ marginTop: '20px',marginLeft:'50px', width: '100px', height: '100px', backgroundColor: color, display: 'flex', alignItems: 'center', justifyContent: 'center', color: 'white', textAlign: 'center' }}>
        Culoarea Rezultată
    </div>
</div>



    <h2>RGBA (Red, Green, Blue, Alpha)</h2>
   <p>RGBA extinde modelul RGB prin adăugarea unui al patrulea component, alpha, care gestionează transparența culorii. Alpha poate lua valori de la 0 (complet transparent) la 1 (complet opac). </p>
    <p> Alpha controlează nivelul de opacitate al culorii, permițând suprapunerea culorilor pe un fundal care poate fi văzut prin culoarea parțial transparentă. </p>
    <p>Valorile alpha sunt adesea reprezentate în procente sau de la 0 la 255, similar cu componentele RGB. </p>
  <p>Este folosit pentru designul web și grafică, unde este necesară suprapunerea elementelor fără a ascunde complet fundalul. </p>



            <h2>Color Combiner Tool</h2>
            
            </div>
           
            </div>

        </>
    )
}
